									set(level.zoom, 1),
									set(level.focus, []),
									remove_object(me),
									title('Ambush!',100),


									map(new_kitties, 'kitty', add_object(kitty) ),
									set(level.gui.vars.bosses, level.gui.vars.bosses + new_kitties),
									
									music('neoBoss.ogg'),
									fire_event(get_object(level,'trap_gate'),'lock')
